s=\"img sp_8MQ_tLRHai7 sx_a04701\">\u003C\/i>\u003C\/span>\u003Cspan class=\"_55pe\">\u003C\/span>\u003C\/a>\u003C\/div>\u003C\/div>\u003Cdiv id=\"cookie_banner_title\" class=\"_9o-d\">\u003Cdiv id=\"consent_cookies_title\">Accepter les cookies de Facebook dans ce navigateur\u00a0?\u003C\/div>\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9o-f\">\u003Cdiv>Nous utilisons des cookies dans le but de personnaliser et d\u2019am\u00e9liorer notre contenu et nos services, de diffuser des publicit\u00e9s pertinentes et d\u2019offrir une exp\u00e9rience plus s\u00fbre. Vous pouvez v\u00e9rifier vos param\u00e8tres de cookies \u00e0 tout moment. Pour en savoir plus sur l\u2019utilisation des cookies et leurs param\u00e8tres, consultez notre \u003Ca href=\"https:\/\/www.facebook.com\/policies\/cookies\/\" class=\"_9o-v\" id=\"cpn-pv-link\">politique d\u2019utilisation des cookies\u003C\/a>.\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9o-r\">\u003Cbutton value=\"1\" class=\"_42ft _4jy0 _9o-s _4jy3 _517h _51sy\" data-cookiebanner=\"manage_button\" data-testid=\"cookie-policy-dialog-manage-button\" title=\"G&#xe9;rer les param&#xe8;tres de donn&#xe9;es\" type=\"submit\" id=\"u_0_19_vE\">G\u00e9rer les param\u00e8tres de donn\u00e9es\u003C\/button>\u003Cbutton value=\"1\" class=\"_42ft _4jy0 _9o-t _4jy3 _4jy1 selected _51sy\" data-cookiebanner=\"accept_button\" data-testid=\"cookie-policy-dialog-accept-button\" title=\"Tout accepter\" type=\"submit\" id=\"u_0_1a_Tp\">Tout accepter\u003C\/button>\u003C\/div>\u003C\/div>\u003C\/div>"},5],["__markup_9f5fac15_0_0_ic",{"__html":"\u003Cdiv>\u003Cdiv class=\"_4-i2 _pig _9o-c _9pll _50f4\">\u003Cdiv class=\"_9o-4 _9qnh\">\u003Cdiv id=\"manage_cookies_title\">Accepter les cookies\u00a0?\u003C\/div>\u003Cdiv class=\"_6a uiPopover\" id=\"u_0_1b_L7\">\u003Ca role=\"button\" class=\"_42ft _4jy0 _55pi _2agf _4o_4 _9o-e _p _4jy3 _517h _51sy\" href=\"#\" style=\"max-width:200px;\" aria-haspopup=\"true\" aria-expanded=\"false\" rel=\"toggle\" id=\"u_0_1c_cz\">\u003Cspan class=\"_-xe _3-8_\">\u003Ci class=\"img sp_8MQ_tLRHai7 sx_a04701\">\u003C\/i>\u003C\/span>\u003Cspan class=\"_55pe\">\u003C\/span>\u003C\/a>\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9o-g\">\u003Cdiv>\u003Cp class=\"_9o-m\">\u003Cdiv>Certains cookies sont n\u00e9cessaires pour utiliser nos services. Pour poursuivre sur Facebook, v\u00e9rifiez les param\u00e8tres pour les cookies et faites tous les changements que vous jugez n\u00e9cessaires avant de cliquer sur Accepter ci-dessous.\u003Cp>\u003Cp>Nous utilisons des cookies notamment pour vous montrer des publicit\u00e9s utiles et pertinentes sur et en dehors de Facebook. Vous pouvez en savoir plus sur notre utilisation des cookies en lisant notre \u003Ca href=\"https:\/\/www.facebook.com\/policies\/cookies\/\" id=\"cpn-pv-link\">Politique d\u2019utilisation des cookies\u003C\/a>. Les outils d\u00e9crits ci-dessous vous offrent \u00e9galement de nombreuses possibilit\u00e9s dehors de vos param\u00e8tres Facebook.\u003C\/p>\u003C\/p>\u003C\/div>\u003C\/p>\u003Cdiv>\u003Cp class=\"_9o-k\">Contr\u00f4les\u003C\/p>\u003Cp>\u003Cdiv>\u003Cdiv class=\"_9o-h\">\u003Cdiv>Accepter le cookie publicitaire principal de Facebook sur ce navigateur, dans le but essentiellement de diffuser, \u00e9valuer et am\u00e9liorer la pertinence des publicit\u00e9s\u00a0?\u003C\/div>\u003Cdiv>\u003Clabel class=\"_9nq9 _9si_\">\u003Cinput name=\"optout_controls\" class=\"_9nqa _9sj1\" type=\"checkbox\" value=\"fr\" \/>\u003Cspan class=\"_9nqb _9sj0\">\u003C\/span>\u003C\/label>\u003C\/div>\u003C\/div>\u003Cp>\u003Cdiv class=\"pam _9o-n uiBoxGray\">\u003Cp class=\"_9o-o\">Si vous ne voulez pas de ce cookie\u00a0:\u003C\/p>\u003Cp class=\"_9o-p\">Vous continuerez \u00e0 voir des publicit\u00e9s lorsque vous \u00eates sur Facebook et nous utiliserons les informations \u00e0 notre disposition pour diffuser, \u00e9valuer et am\u00e9liorer la pertinence des publicit\u00e9s que vous voyez. Cela comprend notamment les informations que vous fournissez lorsque vous utilisez les produits Facebook, les informations li\u00e9es \u00e0 votre appareil et les informations des partenaires collect\u00e9es via des cookies et autres technologies de suivi. Vous pourrez toujours autoriser ce cookie sur des navigateurs ou appareils si vous ne l\u2019acceptez pas maintenant, auquel cas nous utiliserons les informations collect\u00e9es selon ce que vous aurez autoris\u00e9.\u003C\/p>\u003C\/div>\u003C\/p>\u003C\/div>\u003C\/p>\u003Cp>\u003Cdiv>\u003Cdiv class=\"_9o-h\">\u003Cdiv class=\"_9o-i\">Accepter les cookies provenant d\u2019autres entreprises que Facebook et destin\u00e9s \u00e0 optimiser les services, notamment personnaliser les contenus (y compris les publicit\u00e9s), \u00e9valuer les publicit\u00e9s, produire des statistiques et fournir une exp\u00e9rience plus s\u00fbre\u00a0?\u003C\/div>\u003Cdiv>\u003Clabel class=\"_9nq9 _9si_\">\u003Cinput name=\"optout_controls\" class=\"_9nqa _9sj1\" type=\"checkbox\" value=\"third_party\" \/>\u003Cspan class=\"_9nqb _9sj0\">\u003C\/span>\u003C\/label>\u003C\/div>\u003C\/div>\u003Cp>\u003Cdiv class=\"pam _9o-n uiBoxGray\">\u003Cp class=\"_9o-o\">Si vous ne voulez pas de ce cookie\u00a0:\u003C\/p>\u003Cp class=\"_9o-p\">Nous utilisons notamment les cookies d\u2019autres sites pour activer les fonctionnalit\u00e9s qui vous permettent d\u2019inclure des GIF dans vos publications et vos commentaires, de regarder des vid\u00e9os et de jouer \u00e0 des jeux sur Facebook Gaming. Si vous n\u2019acceptez pas les cookies des autres sites, les fonctionnalit\u00e9s de Facebook qui reposent sur les informations de ces sites et applications pourraient ne pas fonctionner.\u003C\/p>\u003C\/div>\u003C\/p>\u003C\/div>\u003C\/p>\u003C\/div>\u003Cdiv>\u003Cp class=\"_9o-k\">Autres fa\u00e7ons de contr\u00f4ler votre suivi\u003C\/p>\u003C\/div>\u003Cdiv>\u003Cdiv class=\"_9vtg\" id=\"u_0_1d_F\/\">\u003Cbutton class=\"_9ngd _9nge\" title=\"expandable section\">\u003Cdiv class=\"_9ngc\">\u003Cspan class=\"_9ngf\">\u003Cdiv class=\"_9o-l\">Param\u00e8tres de votre compte Facebook\u003C\/div>\u003C\/span>\u003Cspan class=\"_9ngg _9v7v\">\u003Ci class=\"img sp_5iYm-45_v_9 sx_aa09c4\">\u003C\/i>\u003C\/span>\u003C\/div>\u003C\/button>\u003Cdiv class=\"_9ngb _9nga\">\u003Cdiv>\u003Cp class=\"_9o-m\">Si vous avez un compte Facebook, vous pouvez g\u00e9rer l\u2019utilisation des diff\u00e9rentes donn\u00e9es pour personnaliser les publicit\u00e9s \u00e0 l\u2019aide de ces outils.\u003C\/p>\u003Cp class=\"_9si-\">Param\u00e8tres des Publicit\u00e9s\u003C\/p>\u003Cp class=\"_9o-m\">Pour vous montrer des publicit\u00e9s plus pertinentes, nous utilisons des donn\u00e9es que les annonceurs et d\u2019autres partenaires nous fournissent \u00e0 propos de votre activit\u00e9 en dehors des Produits des Entit\u00e9s Facebook, y compris sur des sites web et dans des applications. Vous pouvez d\u00e9cider si nous pouvons utiliser ou non ces donn\u00e9es pour vous montrer des publicit\u00e9s dans vos \u003Ca href=\"https:\/\/www.facebook.com\/settings\/ads\/\">param\u00e8tres des Publicit\u00e9s\u003C\/a>.\u003C\/p>\u003Cp class=\"_9o-m\">L\u2019Audience Network de Facebook est un moyen pour les annonceurs de vous montrer des publicit\u00e9s dans des applications et sur des sites web en dehors des \u003Ca href=\"https:\/\/www.facebook.com\/help\/195227921252400\">Produits des Entit\u00e9s Facebook\u003C\/a>. L\u2019Audience Network peut vous montrer des publicit\u00e9s pertinentes notamment en utilisant vos pr\u00e9f\u00e9rences publicitaires pour d\u00e9terminer quelles publicit\u00e9s pourraient vous int\u00e9resser. Vous pouvez changer cela dans vos \u003Ca href=\"https:\/\/www.facebook.com\/settings\/ads\/\">param\u00e8tres des Publicit\u00e9s\u003C\/a>.\u003C\/p>\u003Cp class=\"_9si-\">Pr\u00e9f\u00e9rences publicitaires\u003C\/p>\u003Cp class=\"_9o-m\">Vous pouvez utiliser vos pr\u00e9f\u00e9rences publicitaires pour d\u00e9couvrir pourquoi vous voyez une publicit\u00e9 en particulier et g\u00e9rer la fa\u00e7on dont nous utilisons les informations que nous recueillons pour vous montrer des publicit\u00e9s.\u003C\/p>\u003Cp class=\"_9si-\">Activit\u00e9 en dehors de Facebook\u003C\/p>\u003Cp class=\"_9o-m\">Vous pouvez consulter votre activit\u00e9 en dehors de Facebook, qui consiste en un r\u00e9sum\u00e9 de l\u2019activit\u00e9 que des entreprises et des organisations nous transmettent au sujet de vos interactions avec elles, comme l\u2019utilisation de leurs applications ou vos visites sur leurs sites web. Elles utilisent nos \u003Ca href=\"https:\/\/www.facebook.com\/help\/2230503797265156\">outils Business\u003C\/a>, comme Facebook Login ou le pixel Facebook, pour nous transmettre ces informations. Cela nous permet notamment de vous offrir une exp\u00e9rience plus personnalis\u00e9e sur Facebook. Apprenez-en davantage sur l\u2019\u003Ca href=\"https:\/\/www.facebook.com\/help\/2207256696182627\">activit\u00e9 en dehors de Facebook\u003C\/a>, l\u2019utilisation que nous en faisons et la mani\u00e8re dont vous pouvez la g\u00e9rer.\u003C\/p>\u003C\/div>\u003C\/div>\u003C\/div>\u003C\/div>\u003Cdiv>\u003Cdiv class=\"_9vtg\" id=\"u_0_1e_SE\">\u003Cbutton class=\"_9ngd _9nge\" title=\"expandable section\">\u003Cdiv class=\"_9ngc\">\u003Cspan class=\"_9ngf\">\u003Cdiv class=\"_9o-l\">Plus d\u2019informations sur les publicit\u00e9s en ligne\u003C\/div>\u003C\/span>\u003Cspan class=\"_9ngg _9v7v\">\u003Ci class=\"img sp_5iYm-45_v_9 sx_aa09c4\">\u003C\/i>\u003C\/span>\u003C\/div>\u003C\/button>\u003Cdiv class=\"_9ngb _9nga\">\u003Cdiv>\u003Cp class=\"_9o-m\">Vous pouvez choisir de ne pas voir les publicit\u00e9s en ligne bas\u00e9es sur les centres d\u2019int\u00e9r\u00eat de Facebook et d\u2019autres entreprises participantes via la \u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Foptout.aboutads.info\u00252F&amp;h=AT1_vy6IpeZ6qL03RPSXoxZVhGqsC2K77mxT-yvKx6iZ8MC-yR4vxlDS-RdQMb2qZsj8LtqjxXStHoE3uNRJXy2DoZ3x2pgTpq7qSJFezJRxnzQE0gmNJHwlKEqUyexlRD36YIfcHtOGgeJhSQOOBtgq2KdjC-pFeOekxgCRjyVQpeCl3w\" target=\"_blank\" rel=\"noopener nofollow\" data-lynx-mode=\"async\">Digital Advertising Alliance\u003C\/a> aux \u00c9tats-Unis, la \u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fyouradchoices.ca\u00252F&amp;h=AT2qPU3_xvsrcqkhBVbaq1qfF7PFQAQ0J6AP3lKnEu-ODCpVOP4bKPKoVYSOmZp5JOcQcxcQSGDT4YOWdLTHmxA0eCc6-lUn7vlZWYO8ZkATpRDGlRGqveaim5Bc7hYI75vvI_unTROyFSixYsx-aF_DGUpY5xptS3Kx\" target=\"_blank\" rel=\"noopener nofollow\" data-lynx-mode=\"asynclazy\">Digital Advertising Alliance of Canada\u003C\/a> au Canada et l\u2019\u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fwww.youronlinechoices.com\u00252F&amp;h=AT1e5ve0EEXsMtgmsu1qoU0vh4vUSeH0LqoW2CeqNvenGU4GhwOZHFchCdl-Jzh2uwOSddj0YCa8DLmsoMjHqFFRD8nvOkAEkGkHQ9GzIiU9JT5xTeos0OfYHEZaTWvwfleOTX_GTyOaL5NwA7SkIrKzhxzU93-v9NpT\" target=\"_blank\" rel=\"noopener nofollow\" data-lynx-mode=\"asynclazy\">European Interactive Digital Advertising Alliance\u003C\/a> en Europe, ou encore dans les param\u00e8tres de votre appareil mobile si vous utilisez Android, iOS 13 ou une version d\u2019iOS ant\u00e9rieure. Veuillez noter que les bloqueurs de publicit\u00e9s et les outils qui limitent notre utilisation des cookies peuvent interf\u00e9rer avec ces param\u00e8tres.\u003C\/p>\u003Cp class=\"_9o-m\">Les agences de publicit\u00e9 avec lesquelles nous travaillons utilisent g\u00e9n\u00e9ralement des cookies et des technologies similaires dans la prestation de leurs services. Pour en savoir plus sur la mani\u00e8re dont les annonceurs utilisent g\u00e9n\u00e9ralement les cookies ainsi que sur les choix qu\u2019ils offrent, vous pouvez consulter les ressources suivantes\u00a0:\u003C\/p>\u003Cul class=\"_9o-q\">\u003Cli>\u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Foptout.aboutads.info\u00252F&amp;h=AT3vpiD6uuQjfNJJiwwpFU9RUPWJAjjjL8EjmEafL5V_xvEi599MQPG1366HTinfX9VJCKLivpvD-Fgr8UTwl7vjT7cwSyYuylOczt4ORn1frhjOG21eRdO81es_7bqoLg5k9X-KyCnQ0u6JpNM08m3cMoZXlyBWpjAq\" target=\"_blank\" rel=\"noopener nofollow\" data-lynx-mode=\"asynclazy\">Digital Advertising Alliance\u003C\/a>\u003C\/li>\u003Cli>\u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fyouradchoices.ca\u00252F&amp;h=AT1lq0FOytBd4My-v371cNTxv9CQ7TQWmq1k9aaDeW0zn0QEd4IPZfFNoOOJHgyfMTob3ShYcVPh8cUb2RRq5NcBQ58CminlFpnUSl62isHibMtth04_vfVys8P7gs2N4lNyDXiaksousVK3UzK73ZAVUMYz6SBDk8R7\" target=\"_blank\" rel=\"noopener nofollow\" data-lynx-mode=\"asynclazy\">Digital Advertising Alliance of Canada\u003C\/a>\u003C\/li>\u003Cli>\u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fwww.youronlinechoices.com\u00252F&amp;h=AT1wld_iFkE548naLOjZPAzNpY_KVqk_7pyKHlyyQsM0wl6fABLRDw5ze26yYs3_jgeiWkTfZe5FC0RVoFZ9bjGfQRBcjdqWJZfrgwGIrjwJNmnH6ES7uTboXRalzaAzNzyDCloMIcR0jQ_tzlQ_WVs6oEnXxqMjckLK\" target=\"_blank\" rel=\"noopener nofollow\" data-lynx-mode=\"asynclazy\">European Interactive Digital Advertising Alliance\u003C\/a>\u003C\/li>\u003C\/ul>\u003C\/div>\u003C\/div>\u003C\/div>\u003C\/div>\u003Cdiv>\u003Cdiv class=\"_9vtg\" id=\"u_0_1f_Zh\">\u003Cbutton class=\"_9ngd _9nge\" title=\"expandable section\">\u003Cdiv class=\"_9ngc\">\u003Cspan class=\"_9ngf\">\u003Cdiv class=\"_9o-l\">Contr\u00f4ler les cookies \u00e0 l\u2019aide des param\u00e8tres du navigateur\u003C\/div>\u003C\/span>\u003Cspan class=\"_9ngg _9v7v\">\u003Ci class=\"img sp_5iYm-45_v_9 sx_aa09c4\">\u003C\/i>\u003C\/span>\u003C\/div>\u003C\/button>\u003Cdiv class=\"_9ngb _9nga\">\u003Cdiv>\u003Cp class=\"_9o-m\">Votre navigateur ou appareil peut comprendre des param\u00e8tres vous permettant de choisir d\u2019activer ou non les cookies de navigateur et de les supprimer. Ces param\u00e8tres varient selon le navigateur, et les fabricants peuvent modifier les param\u00e8tres disponibles et leur fonctionnement \u00e0 tout moment. Depuis le 5 octobre 2020, vous pouvez trouver des informations suppl\u00e9mentaires sur les param\u00e8tres propos\u00e9s par les navigateurs les plus populaires en suivant les liens ci-dessous. Certaines fonctionnalit\u00e9s des produits Facebook pourraient ne pas fonctionner correctement si vous avez d\u00e9sactiv\u00e9 l\u2019utilisation des cookies de navigateur. Veuillez noter que ces param\u00e8tres diff\u00e8rent de ceux propos\u00e9s par Facebook.\u003C\/p>\u003Cul class=\"_9o-q\">\u003Cli>\u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fsupport.google.com\u00252Fchrome\u00252Fanswer\u00252F95647&amp;h=AT2tAIhFFDro-CcCKsioLAXVrDO9UOt5VY6jjITQCfS_IU1s2WDPU4ERe3TxtdVhvVDIbiOfQGTU-UzsWzjfZQXSXu5Hx-SxNJxhTQlK9mBl2-STAD4gJiODMU6zraMc9mIU8t3Iub8uYZx0kkjjBQPr-I3Rc4NVSqlU\" target=\"_blank\" rel=\"noopener nofollow\" data-lynx-mode=\"asynclazy\">Google Chrome\u003C\/a>\u003C\/li>\u003Cli>\u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fsupport.microsoft.com\u00252Fen-ie\u00252Fhelp\u00252F17442\u00252Fwindows-internet-explorer-delete-manage-cookies&amp;h=AT0kbL56shkYFfVEk-r0MZwWI3_rZ1buqwRPwKv3Vrbuuxr97_LiPwsnaWEJn8FZt33pyb3LbqPxkxJw5JvP1sTHyACnarHd-W9fMcA6eJRkEqN4kR1-HJmCcPjsz49-GVAjnurayUzr-uASur2CcvKaw7f9rLjuSEpb\" target=\"_blank\" rel=\"noopener nofollow\" data-lynx-mode=\"asynclazy\">Internet Explorer\u003C\/a>\u003C\/li>\u003Cli>\u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fsupport.mozilla.org\u00252Fen-US\u00252Fkb\u00252Fenable-and-disable-cookies-website-preferences&amp;h=AT1jmnwCnzgSjdDGed3OVDqOTDHx4Sk6D4Tq2pnlBbdvjwLzcqgUb5tpa-i1wRnuBCB0FyY7Yfvqkjl3ihWZYCw37-emytsHfabVPl154nV2rzbGgLtXNzNp63DUc1GjBvU2YlLGHhl9u90ZkPz-DJYwR3bMyRny7acI\" target=\"_blank\" rel=\"noopener nofollow\" data-lynx-mode=\"asynclazy\">Firefox\u003C\/a>\u003C\/li>\u003Cli>\u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fsupport.apple.com\u00252Fen-ie\u00252Fguide\u00252Fsafari\u00252Fsfri11471\u00252Fma